import React, {Component} from 'react';
import Fact from './Fact';

class Factlist extends Component {
    render() {
        return this.props.factlist.map((fact) => (
            <Fact key={fact.id} fact={fact} />
        ));
    }
}

// return this.props.factlist.map((fact) => (
// <Fact fact={fact} />
// <div> {fact.text} <div/> 
// ));

export default Factlist;
